import ChartCard from '@/components/ChartCard';
import ACol from "ant-design-vue/es/grid/Col";
import ATooltip from "ant-design-vue/es/tooltip/Tooltip";
import MiniArea from '@/components/chart/MiniArea';
import MiniBar from '@/components/chart/MiniBar';
import MiniProgress from '@/components/chart/MiniProgress';
import RankList from '@/components/chart/RankList';
import Bar from '@/components/chart/Bar';
import LineChartMultid from '@/components/chart/LineChartMultid';
import HeadInfo from '@/components/tools/HeadInfo.vue';
import Trend from '@/components/Trend';
import { getLoginfo, getVisitInfo } from '@/api/api';
var rankList = [];

for (var i = 0; i < 7; i++) {
  rankList.push({
    name: '白鹭岛 ' + (i + 1) + ' 号店',
    total: 1234.56 - i * 100
  });
}

var barData = [];

for (var _i = 0; _i < 12; _i += 1) {
  barData.push({
    x: "".concat(_i + 1, "\u6708"),
    y: Math.floor(Math.random() * 1000) + 200
  });
}

export default {
  name: "Analysis",
  components: {
    ATooltip: ATooltip,
    ACol: ACol,
    ChartCard: ChartCard,
    MiniArea: MiniArea,
    MiniBar: MiniBar,
    MiniProgress: MiniProgress,
    RankList: RankList,
    Bar: Bar,
    Trend: Trend,
    LineChartMultid: LineChartMultid,
    HeadInfo: HeadInfo
  },
  data: function data() {
    var h = this.$createElement;
    return {
      loading: true,
      center: null,
      rankList: rankList,
      barData: barData,
      loginfo: {},
      visitFields: ['ip', 'visit'],
      visitInfo: [],
      indicator: h("a-icon", {
        "attrs": {
          "type": "loading",
          "spin": true
        },
        "style": "font-size: 24px"
      })
    };
  },
  created: function created() {
    var _this = this;

    setTimeout(function () {
      _this.loading = !_this.loading;
    }, 1000);
    this.initLogInfo();
  },
  methods: {
    initLogInfo: function initLogInfo() {
      var _this2 = this;

      getLoginfo(null).then(function (res) {
        if (res.success) {
          Object.keys(res.result).forEach(function (key) {
            res.result[key] = res.result[key] + "";
          });
          _this2.loginfo = res.result;
        }
      });
      getVisitInfo().then(function (res) {
        if (res.success) {
          console.log("aaaaaa", res.result);
          _this2.visitInfo = res.result;
        }
      });
    }
  }
};
